import './App.css';
import Header from './Header.js';
import Body from './Body.js';
import SideBar from './SideBar.js';

function App() {
	return (
		<div className="App">
			<Header/>
    		<div class="blank"></div>
      		<div class="body_section">
        		<Body/>
        		<SideBar/>
      		</div>
    	</div>
  	);
}

export default App;
